import React from 'react';
import { Modal, Button } from 'react-bootstrap';
import { breakpoints } from 'styled-bootstrap-responsive-breakpoints';
import Calendar from './Calendar';
import { styled, className } from 'styled-components';

const Styles = styled.div`

// #modalBody {
//     background-color: #eeeeee;
// }
`
const headerClass = className`
  background: #d65a31;
`

export default function BookWindow(props) {

    return (
        <Styles>
            <Modal size='lg' show={props.show} aria-labelledby="contained-modal-title-vcenter">
                <Modal.Header closeButton modalClassName={headerClass}>
                    <Modal.Title id="contained-modal-title-vcenter">
                        Schedule
                    </Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    <Calendar />
                </Modal.Body>
                <Modal.Footer>
                    <Button onClick={props.onHide}>Close</Button>
                </Modal.Footer>
            </Modal>
        </Styles>
    );
}
